/**
 * responseTotalSize    返回数据的条数
 * getDataFunction      ajax请求function
 * currentPageNum       当前页页码
 * currentPageSize      当前一页显示条数
 * isSimple             是否是简短的样式
 * **/
crmApp.directive("linkagePager",["ngToast",function(ngToast){
    return {
        scope: {
            responseTotalSize : "=",
            getDataFunction : "=",
            currentPageNum : "=",
            currentPageSize : "=",
            isSimple : "@"
        },
        restrict: 'EA',
        template: '<div class="pagination-bar"><div class="pagination-box">' +
                        '<!--下拉框-->'+
                        '<div class="pagination-select" ><select ng-model="currentPageSize" ng-change="changePageSizeAction()" ng-hide="isSimple == \'true\'">' +
                            '<option value="{{paginationSelectItem.key}}" ng-repeat="paginationSelectItem in paginationSelectList">{{paginationSelectItem.value}}</option>' +
                        '</select></div>' +

                        '<span class="btn pagination-btn disabled" ng-if="isFirst || responseTotalSize == 0">第一页</span>' +
                        '<span class="btn pagination-btn" ng-if="!isFirst && responseTotalSize != 0" ng-click="prevPageAction()">上一页</span>' +
                        '<!--翻页、页码按钮组-->'+
                        '<ul class="pagination-list"  ng-if="isSimple != \'true\'"><li class="btn pagination-item pagination-item-active"' +
                            'ng-click="paginationItemAction(currentPageNum)">' +
                            '{{currentPageNum}}' +
                            '</li></ul>' +

                        '<!--简洁版展示当前页数/总页数-->'+
                        '<span class="deep-grey-text text-v-center fl" ng-if="isSimple == \'true\'">{{currentPageNum}}</span>' +
                        '<span class="deep-grey-text text-v-center big-gap fl" ng-if="isSimple == \'true\'">/{{lastPageNumber}}</span>' +

                        '<span class="deep-grey-text text-v-center gap fl" ng-hide="isSimple == \'true\'">共<span>{{lastPageNumber}}</span>页</span>' +

                        '<span class="btn pagination-btn big-gap" ng-if="!isLast && responseTotalSize != 0" ng-click="nextPageAction()">下一页</span>' +
                        '<span class="btn pagination-btn disabled" ng-if="isLast || responseTotalSize == 0">最后一页</span>' +

                        '<!--跳转页码-->'+
                        '<span class="deep-grey-text text-v-center big-gap fl">跳转到</span>' +
                        '<input type="text" class="pagination-input big-gap" ng-model="showPageNum" ng-keydown="toPageNumAction($event)">' +
                        '<span class="deep-grey-text text-v-center big-gap fl">页</span>' +

                        '<span class="deep-grey-text text-v-center fr">显示记录{{(currentPageNum-1)*currentPageSize+1}}-{{(currentPageNum)*currentPageSize}}, 共{{responseTotalSize}}条</span>'+
                        // '<span class="btn pagination-btn big-gap" ng-class="{\'disabled\': responseTotalSize == 0}" ng-click="clickToPageNumAction()">确定</span>' +
                    '</div></div>',
        replace: true,
        link: function(scope, element, attributes, controller) {
            /**
             * params
             * **/
            scope.paginationSelectList = [{"key" : "10","value" : "10"},
                {"key" : "20","value" : "20"},
                {"key" : "50","value" : "50"},
                {"key" : "100","value" : "100"},
                {"key" : "500","value" : "500"}
                ];//下拉条数展示列表
            scope.isFirst = true;//是否是第一页
            scope.isLast = true;//是否是最后一页

            if(scope.currentPageSize === null && typeof scope.currentPageSize === 'undefined'){
                scope.currentPageSize = '10';//当前下拉选中条数(分页大小)
            }
            if(typeof scope.currentPageSize === 'number'){
                scope.currentPageSize = scope.currentPageSize.toString();//当前下拉选中条数(分页大小)
            }
            scope.currentPageNum = '1';//当前页码
            scope.showPageNum = scope.currentPageNum;//跳转展示用的页码

            scope.paginationList = [];//按钮组list  如:[1,2,3,4,-1,6]
            scope.lastPageNumber = 0;
            scope.changFlag = false;
            /**
             * init
             * **/
            scope.$watch('responseTotalSize',function (nV,oV) {
                if(nV != oV){
                    checkPagination();
                }
            });
            scope.$watch('currentPageNum',function (nV,oV) {
                if(nV != oV){
                    scope.showPageNum = scope.currentPageNum;//跳转展示用的页码
                    if(scope.changFlag){
                        scope.getDataFunction();
                        scope.changFlag = false;
                    }
                    checkPagination();
                }
            });
            scope.$watch('currentPageSize',function (nV,oV) {
                if(nV != oV){
                    if(scope.changFlag){
                        scope.getDataFunction();
                        scope.changFlag = false;
                    }
                    checkPagination();
                }
            });
            /************************************Action************************************************************************************/
            /**
             * 跳转页码
             * A、回车触发
             * B、点击触发
             * **/
            scope.toPageNumAction = function (e) { //回车触发跳转
                if(scope.currentPageNum === scope.showPageNum){
                    return;
                }
                var keyCode=e.keyCode ? e.keyCode:e.which?e.which:e.charCode;
                if(keyCode == "13"){
                    if(checkGoToPageNum()){
                        scope.changFlag = true;
                        scope.currentPageNum = scope.showPageNum;//当前页码
                    }
                }
            };
            scope.clickToPageNumAction = function () { //失去焦点触发跳转
                if(scope.currentPageNum === scope.showPageNum){
                    return;
                }
                if(checkGoToPageNum()){
                    scope.changFlag = true;
                    scope.currentPageNum = scope.showPageNum;//当前页码
                }
            };
            /**
             * 下拉框选择页数逻辑
             * **/
            scope.changePageSizeAction = function () {
                scope.changFlag = true;
                scope.currentPageNum = '1';//当前页码
            };
            /**
             * 页码按钮逻辑
             * **/
            scope.paginationItemAction = function (itemNumber) {
                if(itemNumber == '-1'){
                    return;
                }
                scope.changFlag = true;
                scope.currentPageNum = itemNumber;
            };
            /**
             * 上一页
             * **/
            scope.prevPageAction = function () {
                if(scope.currentPageNum == '1'){
                    return;
                }
                scope.changFlag = true;
                scope.currentPageNum--;
            };
            /**
             * 下一页
             * **/
            scope.nextPageAction = function () {
                if(scope.currentPageNum == scope.lastPageNumber){
                    return;
                }
                scope.changFlag = true;
                scope.currentPageNum++;
            };
            /**********************************Function******************************************************************************/
            /**
             * 检查当前页码，展示按钮的paginationList
             * **/
            function checkPagination() {
                //判断最后一页
                var isInt = Number(scope.responseTotalSize)%Number(scope.currentPageSize);
                if(isInt == '0'){
                    scope.lastPageNumber = Number(scope.responseTotalSize)/Number(scope.currentPageSize);
                }else{
                    scope.lastPageNumber = (Number(scope.responseTotalSize)-isInt)/Number(scope.currentPageSize)+1;
                }
                checkIsFirstOrLast(scope.lastPageNumber);
                formatterPaginationList(scope.lastPageNumber);
            }
            /**
             * 检查是否是第一页或者最后一页
             * **/
            function checkIsFirstOrLast(lastPageNum) {
                if(scope.currentPageNum == '1'){
                    scope.isFirst = true;
                }else{
                    scope.isFirst = false;
                }
                if(scope.currentPageNum == lastPageNum){
                    scope.isLast = true;
                }else{
                    scope.isLast = false;
                }
            }
            /**
             * 格式化按钮组list,情况如下：
             * A、当最后一页小于等于8，有多少展示多少 [1,2,3,4,5,6,7,8]
             * B、当最后一页大于8
             *  b1、前面6个，后面省略号，最后一页 [1,2,3,4,5,6,-1,9]
             *  b2、后面6个，前面省略号，第一页 [1,-1,4,5,6,7,8,9]
             *  b3、第一页，省略号，中间5个，省略号，最后一页 [1,-1,3,4,5,6,7,-1,9]
             * **/
            function formatterPaginationList(lastPageNum) {
                // scope.paginationList = [];
                if(lastPageNum <= 8){ //A
                    scope.paginationList = angular.copy(scope.paginationList.slice(0,lastPageNum));
                    for(var i=1;i<=lastPageNum;i++){
                        scope.paginationList[i-1] = i;
                    }
                }else{ //B
                    if(scope.currentPageNum < 5){ //b1----[1,2,3,4,5,6,-1,9]
                        scope.paginationList = angular.copy(scope.paginationList.slice(0,7));
                        for(var j=1;j<=8;j++){
                            if(j < 7){
                                scope.paginationList[j-1] = j;
                            }else if(j === 7){
                                scope.paginationList[j-1] = -1;
                            }else{
                                scope.paginationList[j-1] = lastPageNum;
                            }
                        }
                    }else if(lastPageNum - scope.currentPageNum < 4){ //b2----[1,-1,4,5,6,7,8,9]
                        scope.paginationList = angular.copy(scope.paginationList.slice(0,7));
                        for(var k=7;k>=0;k--){
                            if(k === 7){
                                scope.paginationList[7-k] = 1;
                            }else if(k === 6){
                                scope.paginationList[7-k] = -1;
                            }else if(k < 6){
                                scope.paginationList[7-k] = Number(lastPageNum)-k;
                            }
                        }
                    }else{  //b3----[1,-1,3,4,5,6,7,-1,9]
                        for(var l=0;l<=8;l++){
                            scope.paginationList = angular.copy(scope.paginationList.slice(0));
                            if(l === 0){
                                scope.paginationList[l] = 1;
                            }else if(l === 1 || l === 7){
                                scope.paginationList[l] = -1;
                            }else if(l === 8){
                                scope.paginationList[l] = lastPageNum;
                            }else{
                                scope.paginationList[l] = Number(scope.currentPageNum)-4+l;
                            }
                        }
                    }
                }
            }
            /**
             * 检查输入框的值
             * **/
            function checkGoToPageNum() {
                var tipsStr = '';
                var reg = /^[1-9]\d*$/;
                if(scope.showPageNum > scope.lastPageNumber){
                    tipsStr = '最大页码为:'+scope.lastPageNumber+'<br/>请输入有效页码';
                    toast(tipsStr);
                    scope.showPageNum = "";
                    return false;
                }else if(scope.showPageNum < 1){
                    tipsStr = '最小页码为:1<br/>请输入有效页码';
                    toast(tipsStr);
                    scope.showPageNum = "";
                    return false;
                }else if(scope.showPageNum === "" || scope.showPageNum === undefined){
                    tipsStr = '请输入页码';
                    toast(tipsStr);
                    return false;
                }else if(!reg.test(scope.showPageNum)){
                    tipsStr = '请输入正确页码';
                    toast(tipsStr);
                    return false;
                }else{
                    return true;
                }
            }
            /**
             * warning toast
             * **/
            function toast(string){
                ngToast.create({
                    className: 'warning',
                    timeout:2000,
                    content: string,
                    zIndex : 9999
                });
            }
        }
    }
}]);
crmApp
  .directive('linkageSelect', ['$parse','$timeout','$compile',function ($parse,$timeout,$compile) {
    return {
      restrict: 'A',
      require: '?ngModel',
      scope:{
        ngModel:"=",  //bind
        treeId:"@",   //树的id
        treeData:"=", //树的数据
        treeType:"=", //树的类型，只要配置了treeData，默认下拉是ztree，其它选项：transfer
        nodeConfig:"@", //节点的配置
        includeParent:"@", //是否包含父级
        ngDisabled:"=", // disabled 标识
        lazyload:"@",  //是否需要懒加载（数据比较多的时候）
        selectLazyData:"=", // 搜索后的数据
        selectDataList:"=",// 原数据
        selectKeyValue:"@",//字段和显示字段名
        selectedCallBack:"=",
        callBackParam:"@"
      },
      priority: 10,
      link:function(scope, element, attrs,ngModel){

        /***********************变量区域***********************/

          scope.element = element;//存储当前dom对象
          scope.treeNewData  = [];//将层级节点转换成一维数组形式
          scope.includeParentFg = (scope.includeParent=="true")?true:false;
          scope.treeModel = [];//用于树的格式化的数据

          scope.searchFlag = attrs['liveSearch'];
          scope.dataSize = attrs['size'];

          scope.isClicked = false;
        
          scope.digestNum = 0;
          scope.renderNum = 0;

          scope.isMultiple = attrs.multiple;

          // 懒加载传入的 key 和 value
          scope.keyName = !scope.selectKeyValue?"key":scope.selectKeyValue.split(',')[0];
          scope.valueName = !scope.selectKeyValue?"value":scope.selectKeyValue.split(',')[1];
          scope.lazyLoadOldModel = "";

          scope.wrapHeight = -1;

          // treeType 默认值 处理为ztree
          scope.keyValueLst = [];
          if(attrs.treeData){
            scope.treeType = scope.treeType?scope.treeType:"ztree";
            if(scope.treeType==="transfer"){
              scope.keyValueLst = scope.nodeConfig.split(',')
              scope.transferConfig = {
                targetData : [],//目标列表
                keyValue:''+scope.keyValueLst[1]+','+scope.keyValueLst[2]+'',
                isTree : true,//是否是树形结构
                treeChildrenKey : ''+scope.keyValueLst[0]+'',//是否是树形结构
                onlyChoose : true
              };
            }
          }

          // 穿梭框下拉

        /*************************函数区域************************/



        /***********************初始化区域**********************/


          // 初始化select 并在 树 形式的 逻辑下追加清空搜索树的键入值。
          element.selectpicker().on('hide.bs.select',function(){
            $timeout(function(){
              if(scope.treeType==="ztree"){
                scope.searchTreeKey ="";
              }

              // 懒加载模式下 下拉收起后 需要清空已搜索结果
              if(eval(scope.lazyload)){
                scope.selectLazyData = [];
                // scope.element.selectpicker('refresh');
                angular.element(element[0]).prev('.dropdown-menu').find('.no-results').remove();
              }
            },0)

          });

          // 初始化select 并在 在数据量较大的时候
          // element.selectpicker().on('show.bs.select',function(){
                  
          //     if(scope.treeType==="transfer"&&scope.wrapHeight==-1){

          //       var staticHeight = angular.element(scope.element[0]).prev('div.dropdown-menu')[0].style.maxHeight;

          //       scope.wrapHeight = staticHeight?Number(staticHeight.replace('px','')):160;

          //       // scope.wrapHeight = Number(angular.element(scope.element[0]).prev('div.dropdown-menu')[0].style.maxHeight.replace('px',''))-50;

          //       initTran()
          //     }
              

          // });

          // 懒加载情况下的 数据样式在刷新后的赋值。
          element.selectpicker().on('refreshed.bs.select',function(){
                 
              if(eval(scope.lazyload)){
                // element.prev('.dropdown-menu').find('.selected').addClass('active');
                initLazySelectedHtml();

                // 懒加载模式下的数据初始化
                if(eval(scope.lazyload)){

                  angular.element(element[0]).prev('.dropdown-menu').find('.bs-searchbox').off('input propertychange').on('input propertychange',function(e){
                    e.stopPropagation();
                    var inputVal = angular.element(e.target).val();
                    var filterList = [];
                    if(!myCommon.isEmpty(inputVal)){
                      for(var i = 0;i<scope.selectDataList.length;i++){
                        if(scope.selectDataList[i][scope.valueName].indexOf(inputVal)>-1&&filterList.length<500){
                          filterList.push(scope.selectDataList[i]);
                        }
                      }
                      
                    }

                    $timeout(function(){
                      scope.selectLazyData = filterList;
                      
                      $timeout(function(){
                        angular.element(element[0]).prev('.dropdown-menu').find('.no-results').remove();
                        if(!myCommon.isEmpty(inputVal)){
                          if(filterList.length==0){
                            angular.element(element[0]).prev('.dropdown-menu').find('ul').append('<li class="no-results">没有您搜索的" '+inputVal+'"</li>')
                          }
                        }
                      },100)


                    },0)

                  })

                }

              }

          });

          // 点击树 冒泡 阻止 dropdown menu的时间
          scope.clickTree = function(e){
            e.stopPropagation();
          }

          if(scope.treeType==="ztree"){

            var nodeConfig = scope.nodeConfig.split(',')
            scope.pId = nodeConfig[0];
            scope.Id = nodeConfig[1];
            scope.name = nodeConfig[2];

            initTree();  


            function initTree(){
              scope.setting2 = {
                view: {
                    showIcon:false,
                },
                
                edit: {
                    enable: true,
                },
                check: {
                  enable: true, 
                },
                data: {
                    simpleData: {
                        enable:true,
                        idKey: scope.Id,
                        pIdKey: scope.pId,
                        rootPId: ""
                    },
                    key:{
                    name:scope.name
                  },
                },
                callback: {
                    onCheck:onCheck
                }
                
              }

              if(!attrs.multiple){
                scope.setting2.check.chkStyle = "radio";
                scope.setting2.check.radioType = "all";
              }
              scope.searchTreeKey = ""
              var _html = "";

              scope.wrapHeight = 28*scope.dataSize;

              if(scope.searchFlag){
                _html+= '<div class="bs-searchbox" ng-if="searchFlag"><input type="hidden" class="zTree-search"/><input type="text" class="form-control " autocomplete="off" role="textbox" aria-label="Search" placeholder="请输入" ng-model="$parent.searchTreeKey"></div>'
                scope.wrapHeight = scope.wrapHeight-46;
              }

              _html+= '<div class="tree-drop-menu" style="height:'+scope.wrapHeight+'px"><linkage-tree z-nodes="treeData" node-setting="setting2" tree-id="'+scope.treeId+'" ng-click="clickTree($event)" ng-model="treeModel" search-tree-key="searchTreeKey"></linkage-tree></div>';
              var treeNode = angular.element(scope.element[0]).prev('div.dropdown-menu').html($compile(_html)(scope));
            }
              
              
            

            // 下拉选择
            function onCheck(){
              var treeObj=$.fn.zTree.getZTreeObj(scope.treeId);
              nodes=treeObj.getCheckedNodes(true);

              var checkedList  =  [];
              for(var i = 0;i<nodes.length;i++){

                // 判断是否需要包含父级 如果是单选则必然是需要包含父级的
                if(scope.includeParentFg||!attrs.multiple){
                  if(!nodes[i].getCheckStatus().half){
                    checkedList.push(nodes[i][scope.Id]);
                  }
                }else{
                  if(nodes[i].check_Child_State==-1){
                    checkedList.push(nodes[i][scope.Id]);
                  }
                }
                
              }

              // scope.treeNewData = nodes;
              if(!attrs.multiple){
                scope.ngModel = checkedList[0];
              }else{
                scope.ngModel = checkedList;
              }
            }

            function formatGs(opDataParam){
              for(var i= 0;i<opDataParam.length;i++){
                if(opDataParam[i].children&&opDataParam[i].children.length!==0){

                  var childrenData = opDataParam[i].children;
                  delete opDataParam[i].children;
                  scope.treeNewData.push(opDataParam[i]);
                  formatGs(childrenData);
                }else{
                  scope.treeNewData.push(opDataParam[i]);
                }
              }
            }

            function initSelectedHtml(){
              var showText = [];
              for(var i = 0;i<scope.treeNewData.length;i++){
                for(var j = 0;j<scope.treeModel.length;j++){
                  if(scope.treeModel[j]==scope.treeNewData[i][scope.Id]){
                    showText.push(scope.treeNewData[i][scope.name])
                  }
                }
              }

              angular.element(scope.element[0]).parents('.bootstrap-select').find('.filter-option').text(showText.length==0?"请选择":showText.join(','))
            }

          }else if(scope.treeType==="transfer"){ //穿梭框下拉
            // alert("123")

            initTran();

            //初始化下拉创所框 
            function initTran(){

              scope.wrapHeight = 28*scope.dataSize;

              var _html = "";
              if(scope.searchFlag){
                _html+= '<div class="bs-searchbox" ng-if="searchFlag"><input type="hidden" class="zTree-search"/><input type="text" class="form-control " autocomplete="off" role="textbox" aria-label="Search" placeholder="请输入" ng-model="$parent.searchTreeKey"></div>'
                scope.wrapHeight = scope.wrapHeight-46;
              }

              _html+= '<div class="tree-drop-menu" ng-click="clickTree($event)"><linkage-transfer  source-data="treeData" style="width: 300px;height: '+scope.wrapHeight+'px;" target-data="transferConfig.targetData" key-value="transferConfig.keyValue" is-tree="transferConfig.isTree" tree-children-key="transferConfig.treeChildrenKey" only-choose="transferConfig.onlyChoose" search-param="searchTreeKey"></linkage-transfer>';
              var treeNode = angular.element(scope.element[0]).prev('div.dropdown-menu').html($compile(_html)(scope));

            }


            function formatGs(opDataParam){
              for(var i= 0;i<opDataParam.length;i++){
                if(opDataParam[i][scope.transferConfig.treeChildrenKey]&&opDataParam[i][scope.transferConfig.treeChildrenKey].length!==0){

                  var childrenData = opDataParam[i][scope.transferConfig.treeChildrenKey];
                  delete opDataParam[i][scope.transferConfig.treeChildrenKey];
                  scope.treeNewData.push(opDataParam[i]);
                  formatGs(childrenData);
                }else{
                  scope.treeNewData.push(opDataParam[i]);
                }
              }
            }

            function initSelectedHtml(){
              var showText = [];
              for(var i = 0;i<scope.treeNewData.length;i++){
                // for(var j = 0;j<scope.treeModel.length;j++){
                  if(scope.ngModel==scope.treeNewData[i][scope.keyValueLst[1]]){
                    showText.push(scope.treeNewData[i][scope.keyValueLst[2]])
                  }
                // }
              }

              angular.element(scope.element[0]).parents('.bootstrap-select').find('.filter-option').text(showText.length==0?"请选择":showText.join(','))
            }

      
            

          }

          // 懒加载模式下的数据初始化默认

          function initLazySelectedHtml(){

            var showText = [];
            if(!myCommon.isEmpty(scope.ngModel)){
              for(var i = 0;i<scope.selectDataList.length;i++){
                if(!scope.isMultiple){
                  if(scope.selectDataList[i][scope.keyName]==scope.ngModel){
                    showText.push(scope.selectDataList[i][scope.valueName])
                  }
                }else{
                  for(var j = 0;j<scope.ngModel.length;j++){
                    if(scope.selectDataList[i][scope.keyName]===scope.ngModel[j]){
                      showText.push(scope.selectDataList[i][scope.valueName])
                    }
                  }
                }
                
              }
            }
            
            // console.log(showText)
            angular.element(scope.element[0]).parents('.bootstrap-select').find('.filter-option').text(showText.length==0?"请选择":showText.join(','))
          }

        /***********************监控区域**********************/


          if(scope.treeType==="ztree"){

            scope.$watch('ngModel',function(nv,ov){

              // if(!nv) return;
              
              if(!attrs.multiple){
                scope.treeModel[0] = nv;
              }else{
                scope.treeModel = nv;
              }
              
              initSelectedHtml();

            })

            scope.$watch('treeData',function(nv,ov){
              if(!nv&&nv==ov) return;

              scope.treeNewData = [];

              formatGs(angular.copy(scope.treeData));
              // 处理

              if(scope.ngModel){
                initSelectedHtml();
              }
            })
          }else if(scope.treeType==="transfer"){  

            // 监听下拉
            scope.$watch('transferConfig.targetData',function(nv,ov){

              if(nv&&nv.length>0&&nv!==ov){
                scope.ngModel = nv[0][scope.keyValueLst[1]];

                scope.selectedCallBack(scope.callBackParam,nv[0])

              }

              angular.element(scope.element[0]).prev('.dropdown-menu').parents('.bootstrap-select').removeClass('open');
              

            })

            scope.$watch('ngModel',function(nv,ov){

              // console.log(nv)
              if(nv!==ov){
                initSelectedHtml();
              }

            })

            scope.$watch('treeData',function(nv,ov){
              if(!nv&&nv==ov) return;

              scope.treeNewData = [];

              formatGs(angular.copy(scope.treeData));
              // 处理

              if(scope.ngModel){
                initSelectedHtml();
              }
            })

          }
          else{

            scope.$watch("ngModel", function (newVal, oldVal) {
              if(newVal==oldVal) return;
              scope.$evalAsync(function () {
                element.val(newVal);
                element.selectpicker('refresh');

                // 懒加载且是多选的情况下
                if(eval(scope.lazyload)&&scope.isMultiple){
                  var newModel = newVal;
                  for(var i = 0;i<oldVal.length;i++){
                    var isExits = false;
                    for(var j = 0;j<scope.selectLazyData.length;j++){
                      if(scope.selectLazyData[j][scope.keyName]==oldVal[i]){
                        isExits = true;
                      }
                    }

                    if(!isExits){
                      newModel.splice(0,0,oldVal[i]);
                    }
                  }

                  scope.ngModel = newModel;
                  initLazySelectedHtml();
                  
                }

              });
            });

            ngModel.$render = function () {
              scope.renderNum++;
              // console.log(scope.renderNum);
              scope.$evalAsync(function () {
                  scope.digestNum++;
              });
            }
          }

          scope.$watch('digestNum',function (nV,oV) {
            if(nV === scope.renderNum){
              element.val(ngModel.$modelValue);
              element.selectpicker('refresh');

            }
          });

          scope.$watch('ngDisabled',function(nv,ov){
            // if(nv!=ov){
              $timeout(function(){
                scope.element.selectpicker('refresh');
                if(scope.treeType==="ztree"){
                  initSelectedHtml();
                  initTree();
                }else if(scope.treeType==="transfer"){
                  initSelectedHtml();
                  initTran();
                }
              },100)
            // }
          })

          
      }


        
    };
  }]);

/**
 * 
 * @authors joyXie (xiec@linkstec.com)
 * @date    2018-03-29 14:40:13
 * @function  筛选条件
 */

crmApp.directive("linkageSelectconditions",['$timeout','ngToast',"$sce",function($timeout,ngToast,$sce){
    return {
        scope: {
            conditionsData : "=",  //待选择条件数据
            selectedConditions:"=",//已选择的数据
            conditionKeyValue:"@",//循环条件的主键和显示名的key 和 父级的标识
            tabData:"=",//以及tab显示的数据
            tabKeyValue:"@",//循环条件的主键和显示名的key
            // linkKey:"@"//一级和二级的关联字段   

        },
        restrict: 'EA',
        template: '<div class="select-conditions-wrap">'+
        				'<!--已选择条件-->'+
        				'<div class="selected-list-wrap">'+
                            '<div class="selected-conditions-div">'+
                                '<div class="selected-conditions-title">筛选条件：</div>'+
                                '<div class="clear-condotions-btn" ng-if="selectedConditions.length!=0" ng-click="delAllSelectedCon()">清空</div>'+
                            '</div>'+
        					'<div class="selected-conditions">'+
                                '<ul class="selected-conditions-ul">'+
                                    '<li class="selected-conditions-item" ng-repeat="item in selectedConditions track by $index">'+
                                        '<span class="selected-conditions-name">{{item[conditionValue]}}:{{item.children[0][conditionValue]}}</span>'+
                                        '<i class="lk-icon lk-icon-close-o" ng-click="delSelectCondition(item,$index)"></i>'+
                                    '</li>'+
                                '</ul>'+
                            '</div>'+
        					// '<div class="open-conditions-btn">'+
        					// 	'<button class="btn btn-default btn-outline"><span>展开更多</span><i class="lk-icon lk-icon-arrowD"></i></span>'+
        					// '</div>'+
        				'</div>'+
        				'<!--待选择条件-->'+
        				'<div class="to-select-conditions">'+
        					'<!--一级菜单-->'+
        					'<div class="first-conditions">'+
        						'<ul class="first-conditions-ul">'+
        							'<li class="first-conditions-item" ng-repeat="tab in tabData track by $index" ng-class={"tab-active":curTabKey==tab[tabKey]} ng-click="switchTypeTab(tab)">'+
        								'<span class="first-conditions-name" >{{tab[tabValue]}}</span>'+
        							'</li>'+
        						'</ul>'+
        					'</div>'+
        					'<!--二级菜单-->'+
        					'<div class="second-conditions">'+
        						'<ul class="second-conditions-ul">'+
        							'<li class="second-conditions-item" ng-repeat="condition in conditionsData track by $index" ng-show="curTabKey==condition[tabKey]">'+
        								'<div class="second-conditions-title">{{condition[conditionValue]}}：</div>'+
        								'<div class="third-conditions">'+
        									'<ul class="third-conditions-ul">'+
                                                '<!--一般逻辑-->'+
        										'<li class="third-conditions-item" ng-repeat="itemCon in condition.children track by $index" ng-click="selectCondition(condition,itemCon)" ng-class={"selected-active":checkIsSelect(itemCon)} ng-if="itemCon.colType!=1">'+
        											'<span class="third-conditions-item-name">{{itemCon[conditionValue]}}</span>'+
        										'</li>'+
                                                '<!--阈值 判断-->'+
                                                '<li class="third-conditions-item" ng-repeat="itemCon in condition.children track by $index"  ng-class={"selected-active":checkIsSelect(itemCon)} ng-if="itemCon.colType==1">'+
                                                    // ng-click="selectCondition(condition,itemCon)"
                                                    '<div class="insert-form">'+
                                                        '<div class="form-wrap small-form-wrap" style="margin-right:5px;width:70px"><input type="number" class="form-control" placeholder="请输入" ng-model="itemCon.start"/></div>-'+
                                                        '<div class="form-wrap small-form-wrap" style="margin-left:5px;width:70px"><input type="number" class="form-control" placeholder="请输入" ng-model="itemCon.end"/></div>'+
                                                    '</div>'+
                                                    '<span class="third-conditions-item-name" style="margin:0px 8px">{{itemCon[conditionValue]}}</span>'+
                                                    '<button class="btn btn-blue small-btn" ng-click="moreSearchCondition(condition,itemCon)"><span>添加</span></button>'+
                                                '</li>'+
        									'</ul>'+
        								'</div>'+
        							'</li>'+
        						'</ul>'+
        					'</div>'+
        				'</div>'+
        		  '</div>',
        replace: true,
        link: function(scope, element, attributes, controller) {

            
		/***********************变量区域***********************/

            // console.log()
		    

		    // 父级菜单 对应的 主键和显示变量
		    scope.tabKey = scope.tabKeyValue.split(',')[0];
		    scope.tabValue = scope.tabKeyValue.split(',')[1];

		    // 当前的显示的父级的tab的key
		    scope.curTabKey = scope.tabData.length>0?scope.tabData[0][scope.tabKey]:"";

		    // 条件 对应的 主键和显示变量
		    scope.conditionKey = scope.conditionKeyValue.split(',')[0];
            scope.conditionValue = scope.conditionKeyValue.split(',')[1];

            scope.selectedConditions = scope.selectedConditions?scope.selectedConditions:[];
		    // scope.conditionParentKey = scope.conditionKeyValue.split(',')[2];


		    // 父级和子级的关联的字段
		    // scope.linkKey = 



		/***********************函数区域***********************/

            // 选中某个选项
            scope.selectCondition = function(parentItemParam,itemParam){

                // 判定是否已经添加了该字段的数据
                var parentIsExistIndex = -1;
                var parentExistKey = "";
                var curIsExist = -1;//判断当前点击项是否已经在已选择中

                var item = angular.copy(itemParam);
                if(itemParam.colType=="1"){
                    if((item.start == "" || item.start == undefined) && (item.end == "" || item.end == undefined)){
                        ngToast.warning({
                            timeout:1000,
                            content: '请输入有效内容'
                        });
                        return;
                    }else if((item.start == "" || item.start == undefined) && (item.end != "" && item.end != undefined)){
                        item[scope.conditionValue] = item.end+'以下'+item[scope.conditionValue];
                        item.sql = item.sqlStr+"<"+item.end;
                    }else if((item.start != "" && item.start != undefined) && (item.end == "" || item.end == undefined)){
                        item[scope.conditionValue] = item.start+'以上'+item[scope.conditionValue];
                        item.sql = item.sqlStr+">="+item.start;
                    }else{
                        item[scope.conditionValue] = item.start+"-"+item.end+item[scope.conditionValue];
                        item.sql = item.sqlStr+">="+item.start+" and "+item.sqlStr+"<"+item.end;
                    }

                }

                for(var i =0;i<scope.selectedConditions.length;i++){
                    if(scope.selectedConditions[i][scope.conditionKey]==parentItemParam[scope.conditionKey]){
                        parentIsExistIndex = i;
                        existKey = scope.selectedConditions[i].children[0][scope.conditionKey];

                        if(scope.selectedConditions[i].children[0][scope.conditionKey]==itemParam[scope.conditionKey]){
                            curIsExist = i;

                        }
                    }
                }
                

                // 表示当前选择项已经选择了，取消
                if(curIsExist>-1&&itemParam.colType!="1"){
                    scope.selectedConditions.splice(curIsExist,1);
                    return;
                }

                // 拼接需要存储的数据
                var insertCondition = {};
                insertCondition[scope.conditionKey] = parentItemParam[scope.conditionKey];
                insertCondition[scope.conditionValue] = parentItemParam[scope.conditionValue];
                insertCondition.children = [];

                // 判断是否是 start和end

                if(itemParam.colType=="1"){
                    insertCondition.children.push(item);
                }else{
                    insertCondition.children.push(itemParam);
                }
                

                // 判断是否应存在了
                if(parentIsExistIndex>-1){
                    // 判定下是否是 多选
                    if(parentItemParam.isMuilt==="1"){

                        scope.selectedConditions.push(item);

                    }else{
                        scope.selectedConditions[parentIsExistIndex] = insertCondition;
                         
                    }
                }else{

                    
                    scope.selectedConditions.push(insertCondition);

                }
                
            }


		    // 点击切换以及的类型tab的时候调用
		    scope.switchTypeTab = function(itemParam){
		    	scope.curTabKey = itemParam[scope.tabKey];
		    }

            // 清空所有所选项
            scope.delAllSelectedCon = function(){
                scope.selectedConditions = [];
            }

            // 删除某一个选项
            scope.delSelectCondition = function(itemParam,indexParam){
                scope.selectedConditions.splice(indexParam,1);


            }
            // 为了在待选择区域，已选择的选项设置为蓝色背景的选中状态
            scope.checkIsSelect = function (itemParam) {
                var flag = false;
                for(var i = 0;i<scope.selectedConditions.length;i++){
                    // 判断当前的
                    if(scope.selectedConditions[i].children[0][scope.conditionKey]==itemParam[scope.conditionKey]){
                        flag = true;
                    }
                }
                
                return flag;
            }

            // 添加
            scope.moreSearchCondition = function(parentItemParam,itemParam){
                scope.selectCondition(parentItemParam,itemParam)
            }

    	/***********************初始化区域**********************/


    	/***********************监控区域**********************/
 			
 			// 监控待选择条件数据结构
            scope.$watch('conditionsData',function(nv,ov){
                
            },true)



        }
    }
}])

